import React from 'react';
import { getCourses } from './api/courseApi';

const CoursesList = () => {
    return (
        <table className='table table-bordered'>
            <thead>
                <tr>
                    <th>Title</th>
                    <th>Author ID</th>
                    <th>Category</th>
                </tr>
            </thead>
            <tbody></tbody>
        </table>
    );
};

export default CoursesList;
